query LogIn($username: String!, $password: String!) {
  logIn(username: $username, password: $password) {
    __typename
    code
    token
    message
    success
    user {
      __typename
      ...UserDetails
    }
  }
}
fragment UserDetails on User {
  __typename
  prefix
  given_name
  middle_name
  last_name
  role
}

663f53c9814aef2f6c3fc6ccdca5cb00cbb77de1.source:
mutation Register($username: String!, $password: String!, $role: String!, $givenName: String!, $email: EmailAddress!) {
  register(
    username: $username
    password: $password
    role: $role
    given_name: $givenName
    email: $email
  ) {
    __typename
    code
    token
    success
    message
    user {
      __typename
      ...UserDetails
    }
  }
}
fragment UserDetails on User {
  __typename
  prefix
  given_name
  middle_name
  last_name
  role
}
